import "./Hero.css";
import star from "./star.svg";
const Hero = () => {
return(
    <div className="Hero">
        <div className="Hero__container">
            <div className="Hero__title"></div>
            <div className="Hero__subTitle"></div>
            <div className="Hero__review"></div>
        </div>
    </div>
)
}

export default Hero;
